import React, { Component } from "react";
import { HashRouter as Router,  Route } from "react-router-dom";
import Home from "./Home/Home.js";
import Search from "./Search.js";
import Contact from "./Contact/Contact.js";
import About from "./About.js";
import data from "../SIMULATION_DATABASE/data_BlockNews.json"
// import component xem full bảng tin
import NewsFullView0 from "./Home/news/newsFullView/NewsFullView0.js";
import NewsFullView1 from "./Home/news/newsFullView/NewsFullView1.js";
import NewsFullView2 from "./Home/news/newsFullView/NewsFullView3.js";
import NewsFullView3 from "./Home/news/newsFullView/NewsFullView4.js";
import NewsFullView4 from "./Home/news/newsFullView/NewsFullView5.js";
import NewsFullView5 from "./Home/news/newsFullView/NewsFullView6.js";

class RouterURL extends Component {
  render() {
    return (
      <div>
        <Route exact path="/" component={Home} />
        <Route exact path="/home" component={Home} />
        <Route exact path="/search" component={Search} />
        <Route exact path="/contact" component={Contact} />
        <Route exact path="/about" component={About} />

        {/* chuyển đến trang xem full bảng tin */}
        <Route exact path={"/"+data[0].linkTopic} component={NewsFullView1} />
        <Route exact path={"/"+data[1].linkTopic}  component={NewsFullView2} />
        <Route exact path={"/"+data[2].linkTopic}  component={NewsFullView3} />
        <Route exact path={"/"+data[3].linkTopic}  component={NewsFullView4} />
        <Route exact path={"/"+data[4].linkTopic}  component={NewsFullView5} />
        <Route exact path={"/"+data[5].linkTopic}  component={NewsFullView6} />
      </div>
    );
  }
}

export default RouterURL;
